import axios from "axios";

const queryPokemon = async (name) => {
    const resp = await axios.get(`https://pokeapi.co/api/v2/pokemon/${name}`);

    axios
        .get(`http://localhost:4000/${id}`, {
            params: {
                id: id,
            },
        })
        .then((res) => {
            console.log("res", res);
        })
        .catch((err) => console.log(err));
    console.log("resp5", resp);
    return resp;
};

export default queryPokemon;
